function Header() {
    return (
        <header style={{ width: '80%', margin: 'auto' }}>
            <h1 style={
                { 
                    margin: '0 0 0 0',
                    padding: '3rem 0 3rem 0',
                    fontSize: '60px'
                }
            }>TODO LIST</h1>
            <hr style={{ marginTop: '0', marginBottom: '2rem' }}></hr>
        </header>
    );
}

export default Header;
